import styled from 'styled-components';
import React, {} from 'react';
import {Container} from '../../style/styled';
import {ModalLayer, ModalButton} from '../style/ModalStyle';

export const ModalComp = (props) =>{



    return(
        <>  
            <ModalContainer 
                containerStateColor={props.containerState.color}
                containerStateOpacity={props.containerState.opacity}
            >
                <h2>Modal</h2> 
                <ModalButton onClick={()=>{
                    props.click();
                    }}>
                        Modal
                </ModalButton>
                <ModalLayer layerDisplay={props.layerDisplay}></ModalLayer>
            </ModalContainer>
        </>
    )
}
